import React from 'react';
// import logo from './logo.svg';
// import './App.css';
import NavbarSection from '../home/NavbarSection';
import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import HomeBackgroundImage from '../../assets/img/home-background.png'

const useStyles = makeStyles(theme => ({
  root: {
    '& > *': {
      margin: theme.spacing(1),
    },
  },
}));

export default function Home() {
  const classes = useStyles();

  return (
    <div>
      <Header
        color="transparent"
        routes={dashboardRoutes}
        brand=""
        rightLinks={<HeaderLinks />}
        fixed
        changeColorOnScroll={{
          height: 400,
          color: "white"
        }}
        {...rest}
      />
      {/* <ImageBackground source={} style={{ width: '100%', height: '100%' }}>
        <Text>Inside</Text>
      </ImageBackground> */}
      <div styles={{ backgroundImage: `url(${HomeBackgroundImage})` }}>
        {/* <div styles={{ backgroundImage: "url(" + HomeBackgroundImage + ")" }}> */}
        <h1>This is red car</h1>
      </div>
      {/* <img src={HomeBackgroundImage}/> */}
      <NavbarSection />
      <div className={classes.root}>
        <Button variant="contained">Default</Button>
        <Button variant="contained" color="primary">
          Primary
      </Button>
        <Button variant="contained" color="secondary">
          Secondary
      </Button>
        <Button variant="contained" disabled>
          Disabled
      </Button>
        <Button variant="contained" color="primary" href="#contained-buttons">
          Link
      </Button>
      </div>
    </div>
  )
}
